  return (
    <div className="min-h-screen w-full flex items-center justify-center bg-gray-50 px-4">
      <div className="w-full max-w-md flex flex-col items-center gap-6">
        {/* 상단 서비스 타이틀 */}
        <div className="text-center mt-8">
          <h1 className="text-4xl font-extrabold tracking-tight">AI CARE</h1>
          {/* 필요하면 서브카피 */}
          {/* <p className="text-gray-500 mt-2">보호자 전용 케어 포털</p> */}
        </div>

        {/* 기존 로그인 화면을 그대로 삽입 */}
        <div className="w-full">
          <LoginForm />
        </div>

        {/* 푸터 문구(선택) */}
        {/* <p className="text-xs text-gray-400">© {new Date().getFullYear()} AI CARE</p> */}
      </div>
    </div>
  );
}
